package com.jtons.personnel.res;public enum ResponseEnum {    SERVER_INNER_ERR("500","服务异常"),    SERVER_LOGIN_ERR("401","登录失效"),    SUCCESS("200","操作成功");    ResponseEnum(String code, String msg) {        this.code = code;        this.msg = msg;    }    private String code;    private String msg;    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getMsg() {        return msg;    }    public void setMsg(String msg) {        this.msg = msg;    }}